                ],
                component: <Input placeholder="请输入" />,
            },
            {
                label: "用户密码",
                id: "UserPasswd",
                initialValue: "",
                rules: [
                    // {
                    //     required: true,
                    //     message: "参数不能为空",
                    // },
                    // {
                    //     validator: checkLength(32),
                    //     trigger: ["change", "blur"],
                    // },
                ],
                component: (
                    <Input
                        placeholder="需修改密码，请输入新密码"
                        type="password"
                    />
                ),
            },
            {
                label: "用户名称",
                id: "UserName",
                initialValue: "",
                rules: [
                    {
                        required: true,
                        message: "参数不能为空",
                    },
                    {
                        validator: checkLength(32),
                        trigger: ["change", "blur"],
                    },
                ],
                component: <Input placeholder="请输入" />,
            },
            {
                label: "用户类型",
                id: "UserType",
                initialValue: "1",
                rules: [
                    {
                        required: true,
                        message: "参数不能为空",
                    },
                ],
                component: SelectOption(dict.userType, {
                    onChange: this.userTypeChange,
                    placeholder: "请选择",
                    // allowClear: true,
                    style: {
                        width: 400,
                    },
                }),
            },

            {
                label: "用户风控组",
                id: "RiskGroup",
                initialValue: "",
                rules: [
                    {
                        required: true,
                        message: "参数不能为空",
                    },
                ],
                component:
                    // <Input placeholder="请输入" readOnly disabled />
                    SelectOption(this.state.riskList, {
                        placeholder: "请选择用户风控组",
                    }),
            },
            {
                label: "算法权限组",
                id: "AlgoGroup",
                initialValue: "",
                rules: [
                    {
                        required: true,
                        message: "参数不能为空",
                    },
                ],
                component: SelectOption(this.state.algoSecList, {
                    placeholder: "请选择算法权限组",
                }),
            },
            {
                label: "用户状态",
                id: "UserStatus",
                initialValue: "1",
                rules: [
                    {
