                    },
                ],
                component: SelectOption(dict.userStatus, {
                    placeholder: "请选择",
                    // allowClear: true,
                    style: {
                        width: 400,
                    },
                }),
            },
            {
                label: "证件号码",
                id: "IdentityId",
                initialValue: "",
                rules: [
                    {
                        required: true,
                        message: "参数不能为空",
                    },
                    {
                        validator: checkLength(18),
                        trigger: ["change", "blur"],
                    },
                ],
                component: <Input placeholder="请输入" />,
            },
            // {
            //     label: "机构编码",
            //     id: "OrganizaId",
            //     initialValue: "",
            //     rules: [
            //         {
            //             required: true,
