            //             trigger: ["change", "blur"],
            //         },
            //     ],
            //     component: <Input placeholder="请输入" />,
            // },
        ];
    };
    getSearchFormFields = () => {
        return [
            {
                label: <span>用&nbsp;户&nbsp;名&nbsp;称</span>,
                // label: (
                //     <span>用&nbsp;&nbsp;&nbsp;户&nbsp;&nbsp;&nbsp;名称</span>
                // ),
                id: "userName",
                component: <Input placeholder="请输入" />,
            },
            {
                // label: "用户ID",
                label: <span>用&nbsp;户&nbsp;账&nbsp;户</span>,
                id: "userId",
                component: <Input placeholder="请输入" />,
            },
            {
                // label: "用户类型",
                label: <span>用&nbsp;户&nbsp;类&nbsp;型</span>,
                id: "userType",
                // initialValue: "1",
                component: SelectOption(dict.userType, {
                    placeholder: "请选择",
                    allowClear: true,
                    style: {
                        width: 190,
                    },
                }),
            },
            {
                label: "用户风控组",
                id: "riskGroup",
                component: SelectOption(this.state.riskList, {
                    allowClear: true,
                    style: {
                        width: 190,
                    },
                    placeholder: "请选择",
                }),
            },
            {
                label: "算法权限组",
                id: "algoGroup",
                component: SelectOption(this.state.algoSecList, {
                    allowClear: true,
                    placeholder: "请选择",
                }),
            },
            {
                label: <span>&nbsp;机&nbsp;构&nbsp;名&nbsp;称</span>,
                id: "organizaName",
                component: SelectOption(this.state.organizationList, {
                    placeholder: "请选择",
                }),
                // component: <Input placeholder="请输入" />,
            },
            {
                label: (
                    <span>
                        产&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;品
                    </span>
                ),
                // label: "产品",
                id: "fatherId",
                component: (
                    <Select
                        style={{ width: 190 }}
                        placeholder="请选择"
                        allowClear={true}
                    >
                        {this.state.parentInfoList.map((item, index) => {
                            return (
                                <Select.Option
                                    key={item.id}
                                    value={item.id / 1}
                                >
                                    {item.userName}
                                </Select.Option>
                            );
                        })}
                    </Select>
                ),
            },
        ];
    };

    columns = (params) => {
        return [
            {
                title: "用户ID",
                dataIndex: "id",
                width: 100,
            },
            {
                title: "机构名称",
                dataIndex: "organizaName",
