                dataIndex: "parentName",
                width: 180,
            },
            {
                title: "用户账户",
                dataIndex: "userId",
                width: 140,
            },
            {
                title: "用户名称",
                dataIndex: "userName",
                key: "userName",
                width: 140,
            },
            {
                title: "用户类型",
                dataIndex: "userTypeValue",
                width: 170,
                // key: "userType",
                render: (text, record) => {
                    // console.log(record);
                    if (record.userType == 1) {
                        return (
                            <div className={styles.typeWrap}>
                                <span className={styles.userType1}>个</span>
                                <span>{record.userTypeValue}</span>
                            </div>
                        );
                    } else if (record.userType == 2) {
                        return (
                            <div className={styles.typeWrap}>
                                <span className={styles.userType2}>算</span>
                                <span>{record.userTypeValue}</span>
                            </div>
                        );
                    } else if (record.userType == 3) {
                        return (
                            <div className={styles.typeWrap}>
                                <span className={styles.userType3}>多</span>
                                <span>{record.userTypeValue}</span>
                            </div>
                        );
                    } else if (record.userType == 4) {
                        return (
                            <div className={styles.typeWrap}>
                                <span className={styles.userType4}>行</span>
                                <span>{record.userTypeValue}</span>
                            </div>
                        );
                    }
                    return (
                        <div className={styles.typeWrap}>
                            {record.userTypeValue}
                        </div>
                    );
                },
            },
            {
                title: "用户风控组",
                dataIndex: "riskName",
                width: 150,
                render: (text, record) => (
                    <div
                        onClick={(e) => {
                            this.handleUpdate(record);
                        }}
                    >
                        <Tooltip title="修改风控组">
                            {record.riskName}
                            {this.authObj.isUpdate && (
                                <Icon
                                    type="edit"
                                    style={{ color: "#1899ff" }}
                                />
                            )}
                        </Tooltip>
                    </div>
                ),
            },
            {
                title: "算法权限组",
                dataIndex: "groupName",
                width: 120,
                render: (text, record) => (
                    <div
                        onClick={(e) => {
                            this.handleUpdateAlgo(record);
                        }}
                    >
                        <Tooltip title="修改算法权限组">
                            {record.groupName}
                            {this.authObj.isUpdate && (
                                <Icon
                                    type="edit"
                                    style={{ color: "#1899ff" }}
                                />
                            )}
                        </Tooltip>
                    </div>
